import React from 'react';
import { Text, View } from 'react-native';
import { CountriesProps } from '../constants/RootStack';

export default function CityScreen({ route, navigation }: CountriesProps) {
    return (
      <View>
          <View>
              <Text>Population:</Text>
              <Text>123</Text>
          </View>
      </View>
    );
}
